import React from 'react';
import { Box, Link } from '@chakra-ui/core';

const Footer = () => (
  <Box textAlign="center" fontSize="18" p="10px" bg="gray.100">
    {'</> coded with <3 by '}
    <Link href="https://victorlandim.com">Victor Landim</Link>. {new Date().getFullYear()}
  </Box>
);

export default Footer;
